import React, {useEffect} from 'react'
import {LobbyForm} from './createLobbyForm'
import {useDispatch, useSelector} from 'react-redux'
import { goToLobby } from '../../actions/joinRoomActions'

export const UserHomepage = (props) => {
    const dispatch = useDispatch();
    const lobby = useSelector(state => state.userHome.goToLobby)
    useEffect(() => {

    })

    const handleChange = () => {
        dispatch(goToLobby())
    }

    if(lobby === true) {
        return  <LobbyForm/>
    }
    return(
        <div>
        <h1>This the users homepage</h1>
        <div onClick={() => handleChange()}>
        <h3>Create a Lobby</h3>
        </div>
        <h3>Create your own collection</h3>
        </div>
    )
}

export default UserHomepage
